import React from 'react';
import { Row , Col } from 'antd';
import { Button } from 'antd';
import { Modal } from 'antd';

class ModalExampleInterpolation extends React.Component{
    render() {
        return (
            <div>
                <Modal
                    title = 'ตัวอย่าง'
                    visible = {this.props.visible}
                    onOk = {this.props.onOk}
                    onCancel = {this.props.onOk}
                    footer = {[
                        <Button type = 'primary' onClick={this.props.onOk}>
                            Ok
                        </Button>
                    ]}
                >
                    {this.props.hasData ?
                        this.props.apiData.map((x,i) => (
                            <Row>
                                <Col span={12}>{x['id']+1}</Col>
                                <Col span={12}>
                                    <Button type='primary' name={'insert_' + i} onClick={this.props.onClick}>Insert</Button>
                                </Col>
                                <hr/>
                            </Row>
                        ))
                        : <span style={{fontSize: "25px" , textAlign: "center"}}>กำลังโหลดข้อมูล</span>
                    }
                </Modal>
            </div>
        )
    }
}

export default ModalExampleInterpolation
